import React from 'react';
import '../App.css';
import Navigation from './minor/Navigation'
import PublicArray from './minor/PublicArray'
import Modal from "react-bootstrap/Modal";
import "bootstrap/dist/css/bootstrap.min.css";
//import Bubble from './minor/bubble';

class Speakers extends React.Component { 

  //the states of emotion and source will be set to null initially until the user had filled out the form.
  constructor() {
    super();
    this.state = {
      isOpen: true,
    };
    this.showModal = (this.showModal.bind(this))
    this.hideModal = (this.hideModal.bind(this))
  }

  showModal = () => {
    this.setState({showModal: true})
  }

  hideModal = () => {
    this.setState({showModal: false})
  }


  render()
  {  
    return (
      <div>
        <Modal show={true} onHide={this.hideModal}>
          <Modal.Header>Welcome to Sense of Self Season 2</Modal.Header>
         <Modal.Body>asdfasdf</Modal.Body>
          <Modal.Footer>
          <button onClick={this.hideModal}>Cancel</button>
          </Modal.Footer>

        </Modal>
        <Navigation></Navigation>
        <div className="contentWrapper">  
        <PublicArray></PublicArray>
        {/*<Bubble></Bubble>*/}
        </div>
      </div>
    )        
  }
}
export default Speakers;
